import { Outlet} from "react-router-dom"
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
//import { ContextProvider, ThemeContext } from "./Components/utils/global.context";
import { ContextProvider, ThemeContext } from "./Components/utils/global.context";

function App() {

  return (
    // <ContextProvider>
    <ThemeContext>
      <div className="App">
          <Navbar/>
          <Outlet />
          <Footer/>
      </div>
    </ThemeContext>
      
    // </ContextProvider>   
  );
}

export default App;
